import { Outlet, Link } from "react-router-dom";
import logo from '../Res/logo.png';

export default function upload() {
  return (
    <header>
      <div className="logo">
        <img src={logo} />
      </div>
      <nav className="menu">
        <p><Link to="/">Home</Link>
        {" "}|{" "} 
        Upload CSV
        </p>
      </nav>
    </header>
  );

}
